  isUnitIrregular(element, subEle, nextDateData, resultVal) {
    const containsDigit = (value) => /\d/.test(resultVal);
    if (!containsDigit(resultVal)) {
      return { isUnitIrregular: false, resultVal, minRange: nextDateData["MinRange"], maxRange: nextDateData["MaxRange"] };
    }
    const currentUnit = element.Units.toLowerCase();
    const nextUnit = nextDateData.Units.toLowerCase();
    let minRange = nextDateData["MinRange"];
    let maxRange = nextDateData["MaxRange"];
    const extractNumericValue = (value) => {
      if (typeof value === "string") {
        const specialChar = value.match(/^[^0-9.]*/)?.[0] || "";
        const numericPart = value.replace(/[^0-9.]/g, "");
        return { specialChar, numericVal: numericPart ? parseFloat(numericPart) : NaN };
      }
      return { specialChar: "", numericVal: parseFloat(value) };
    };
    if (!subEle.selected && nextDateData.Units && currentUnit !== nextUnit) {
      let findMatchingForNext = this.testUnitConversionList.find((x) => x.TrendTestUnit.toLowerCase() === currentUnit && x.Analyte === element.Parameter && x.TestUnit.toLowerCase() === nextUnit);
      if (!findMatchingForNext) {
        findMatchingForNext = this.testUnitConversionList.find((x) => x.TrendTestUnit.toLowerCase() === currentUnit && x.TestUnit.toLowerCase() === nextUnit);
      }
      if (findMatchingForNext) {
        const number = parseFloat(findMatchingForNext.ConversionFormula.slice(1));
        const operator = findMatchingForNext.ConversionFormula[0];
        const { specialChar: resultChar, numericVal: parsedResultVal } = extractNumericValue(resultVal);
        const { specialChar: minChar, numericVal: parsedMinRange } = extractNumericValue(minRange);
        const { specialChar: maxChar, numericVal: parsedMaxRange } = extractNumericValue(maxRange);
        if (!isNaN(parsedResultVal)) {
          resultVal = `${resultChar}${(operator === "*" ? parsedResultVal * number : operator === "/" ? parsedResultVal / number : parsedResultVal).toFixed(2)}`;
        }
        if (!isNaN(parsedMinRange)) {
          minRange = `${minChar}${(operator === "*" ? parsedMinRange * number : operator === "/" ? parsedMinRange / number : parsedMinRange).toFixed(2)}`;
        }
        if (!isNaN(parsedMaxRange)) {
          maxRange = `${maxChar}${(operator === "*" ? parsedMaxRange * number : operator === "/" ? parsedMaxRange / number : parsedMaxRange).toFixed(2)}`;
        }
      } else if (this.testUnitConversionList.some((x) => x.TrendTestUnit.toLowerCase() === nextUnit)) {
        return { isUnitIrregular: true, resultVal, minRange, maxRange };
      } else {
        return { isUnitIrregular: false, resultVal, minRange, maxRange };
      }
    }
    return { isUnitIrregular: false, resultVal, minRange, maxRange };
  }
